import React, { Component } from 'react';
import axios from 'axios';

class MyComponent extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [],
    };
  }

  componentDidMount() {
    axios.get('/api/maas360')
      .then((response) => {
        this.setState({ data: response.data });
      })
      .catch((error) => {
        console.log(error);
      });
  }

  render() {
    return (
      <div>
        <h2>Device List</h2>
        {this.state.data.map(device => (
          <div key={device.id}>
            <h3>{device.name}</h3>
            <p>OS: {device.os}</p>
          </div>
        ))}
      </div>
    );
  }
}

export default MyComponent;
